    const SHOP_DATA = useContext(ProductContext);
    return (
        <div>
{ SHOP_DATA.map((product) =>(

   <div key={product.id}>
   <h2> {product.name}</h2>
    <div>{product.price}</div> 
    </div>

))}
        </div>
    )
};

export default Shop;
